import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import './Category.css';

const Category = () => {
  const categories = {
    freeWorkoutPlans: [
      { imgSrc: '/free1.jpg', title: 'Free Plan 1', description: 'Beginner-friendly workout plan.' },
      { imgSrc: '/free2.jpg', title: 'Free Plan 2', description: 'Intermediate level plan for strength.' },
      { imgSrc: '/free3.jpg', title: 'Free Plan 3', description: 'Cardio and endurance training.' },
      { imgSrc: '/free4.jpg', title: 'Free Plan 4', description: 'Stretching and flexibility exercises.' },
      { imgSrc: '/free5.jpg', title: 'Free Plan 5', description: 'HIIT workouts for fat loss.' },
      { imgSrc: '/free6.jpg', title: 'Free Plan 6', description: 'Strength and conditioning.' },
      { imgSrc: '/free7.jpg', title: 'Free Plan 7', description: 'Core strengthening routines.' },
      { imgSrc: '/free8.jpg', title: 'Free Plan 8', description: 'Full body workout plan.' },
    ],
    paidWorkoutPlans: [
      { imgSrc: '/paid1.jpg', title: 'Paid Plan 1', description: 'Exclusive trainer workout plan.' },
      { imgSrc: '/paid2.jpg', title: 'Paid Plan 2', description: 'Strength-focused advanced plan.' },
      { imgSrc: '/paid3.jpg', title: 'Paid Plan 3', description: 'Muscle-building workout sessions.' },
      { imgSrc: '/paid4.jpg', title: 'Paid Plan 4', description: 'Power and endurance drills.' },
      { imgSrc: '/paid5.jpg', title: 'Paid Plan 5', description: 'Advanced HIIT and strength routine.' },
      { imgSrc: '/paid6.jpg', title: 'Paid Plan 6', description: 'Customized progressive overload plan.' },
      { imgSrc: '/paid7.jpg', title: 'Paid Plan 7', description: 'Full body sculpting and toning.' },
      { imgSrc: '/paid8.jpg', title: 'Paid Plan 8', description: 'Fat-burning endurance workouts.' },
    ],
    workoutWithNutrition: [
      { imgSrc: '/nutrition1.jpg', title: 'Nutrition Plan 1', description: 'Full nutrition and workout guide.' },
      { imgSrc: '/nutrition2.jpg', title: 'Nutrition Plan 2', description: 'Meal plan + cardio workout routine.' },
      { imgSrc: '/nutrition3.jpg', title: 'Nutrition Plan 3', description: 'Strength and meal combo plan.' },
      { imgSrc: '/nutrition4.jpg', title: 'Nutrition Plan 4', description: 'HIIT sessions with meal plans.' },
      { imgSrc: '/nutrition5.jpg', title: 'Nutrition Plan 5', description: 'Vegan meals and workout guide.' },
      { imgSrc: '/nutrition6.jpg', title: 'Nutrition Plan 6', description: 'Keto diet and workout plan.' },
      { imgSrc: '/nutrition7.jpg', title: 'Nutrition Plan 7', description: 'High-protein meal and strength plan.' },
      { imgSrc: '/nutrition8.jpg', title: 'Nutrition Plan 8', description: 'Weight loss diet with exercise.' },
    ],
    customizeWorkout: [
      { imgSrc: '/custom1.jpg', title: 'Customize Plan 1', description: 'Tailored strength and cardio routine.' },
      { imgSrc: '/custom2.jpg', title: 'Customize Plan 2', description: 'Personalized HIIT workout.' },
      { imgSrc: '/custom3.jpg', title: 'Customize Plan 3', description: 'Core strength and muscle building.' },
      { imgSrc: '/custom4.jpg', title: 'Customize Plan 4', description: 'Targeted fat-loss program.' },
      { imgSrc: '/custom5.jpg', title: 'Customize Plan 5', description: 'Advanced athletic performance.' },
      { imgSrc: '/custom6.jpg', title: 'Customize Plan 6', description: 'Hybrid power and endurance.' },
      { imgSrc: '/custom7.jpg', title: 'Customize Plan 7', description: 'Strength-building personalized plan.' },
      { imgSrc: '/custom8.jpg', title: 'Customize Plan 8', description: 'Endurance and agility training.' },
    ],
    dietPlans: [
      { imgSrc: '/diet1.jpg', title: 'Diet Plan 1', description: 'Weight loss diet with low carbs.' },
      { imgSrc: '/diet2.jpg', title: 'Diet Plan 2', description: 'Protein-focused muscle-building diet.' },
      { imgSrc: '/diet3.jpg', title: 'Diet Plan 3', description: 'Balanced diet for energy and focus.' },
      { imgSrc: '/diet4.jpg', title: 'Diet Plan 4', description: 'High-protein vegetarian meal plan.' },
      { imgSrc: '/diet5.jpg', title: 'Diet Plan 5', description: 'Keto-based fat loss diet plan.' },
      { imgSrc: '/diet6.jpg', title: 'Diet Plan 6', description: 'Vegan nutrition plan.' },
      { imgSrc: '/diet7.jpg', title: 'Diet Plan 7', description: 'Custom tailored meal plan.' },
      { imgSrc: '/diet8.jpg', title: 'Diet Plan 8', description: 'Low-calorie high-protein diet.' },
    ],
    personalCoach: [
      { imgSrc: '/coach1.jpg', title: 'Coach Plan 1', description: 'One-on-one coaching sessions.' },
      { imgSrc: '/coach2.jpg', title: 'Coach Plan 2', description: 'Tailored strength workout with coach.' },
      { imgSrc: '/coach3.jpg', title: 'Coach Plan 3', description: 'Cardio-based program with expert.' },
      { imgSrc: '/coach4.jpg', title: 'Coach Plan 4', description: 'HIIT coaching and progress tracking.' },
      { imgSrc: '/coach5.jpg', title: 'Coach Plan 5', description: 'Custom workout plans with personal coach.' },
      { imgSrc: '/coach6.jpg', title: 'Coach Plan 6', description: 'Specialized strength and recovery plans.' },
      { imgSrc: '/coach7.jpg', title: 'Coach Plan 7', description: 'In-depth diet and training coaching.' },
      { imgSrc: '/coach8.jpg', title: 'Coach Plan 8', description: 'Personalized fitness guidance.' },
    ]
  };

  const renderCategoryItems = (items) => {
    return items.map((item, index) => (
      <div className="category-item" key={index}>
        <img src={item.imgSrc} alt={item.title} />
        <h3>{item.title}</h3>
        <p>{item.description}</p>
      </div>
    ));
  };

  const renderCategorySection = (title, category) => {
    return (
      <div className="category-section">
        <h3 className="category-title">{title}</h3>
        <Carousel showThumbs={false} infiniteLoop useKeyboardArrows autoPlay interval={3000} showStatus={false}>
          <div className="category-row">
            {renderCategoryItems(category.slice(0, 4))}
          </div>
          <div className="category-row">
            {renderCategoryItems(category.slice(4, 8))}
          </div>
        </Carousel>
      </div>
    );
  };

  return (
    <div className="categories-container">
      <h2 className="section-title">Categories</h2>

      {renderCategorySection('Free Workout Plans', categories.freeWorkoutPlans)}
      {renderCategorySection('Paid Workout Plans', categories.paidWorkoutPlans)}
      {renderCategorySection('Workout with Nutrition Guidance', categories.workoutWithNutrition)}
      {renderCategorySection('Customize Your Workout', categories.customizeWorkout)}
      {renderCategorySection('Diet Plans', categories.dietPlans)}
      {renderCategorySection('Personal Coach', categories.personalCoach)}
    </div>
  );
};

export default Categories;
